import React, {Component} from 'react';

function Navbar(){
  return(
    <nav>
      <ul>
        <li><a href="#"><h3>DigitalQ</h3></a></li>
        <li><a href="#about"><h3>About</h3></a></li>
        <li><a href="#product"><h3>Product</h3></a></li>
        <li><a href="#contact"><h3>DigitalQ</h3></a></li>
        <li><a href="review.js"><h3>Review</h3></a></li>
        <li><a href="login.js"><h3>LOGIN</h3></a></li>
      </ul>
    </nav>
  );
}

function Header(){
  return(
    <header>
      <h2>Selamat Datang di</h2>
      <h1>DigitalQ</h1>
      <a href="#about">CARI TAHU SEKARANG</a>
    </header>
  );
}

function Section1(){
  return(
    <section id="about">
      <u>Sekilas Tentang Kami</u>
      <p><b>DigitalQ </b>merupakan toko elektronik terpercaya yang menjual bervariasi laptop dan handphone berkualitas dengan harga terjangkau. DigitalQ siap menjamin kepuasan pelanggan.</p>
      <img src="2.jpg" />
    </section>
  );
}

function Section2(){
  return(
    <section id="product">
      <h2>PRODUK</h2>
      <h3>Apa yang Anda Cari?</h3>
      <p><a href="produk.js#laptop"><b>LAPTOP</b></a></p>          
      <p><a href="produk.js#hp"></a><b>HANDPHONE</b></p>
      <p><a href="produk.js#dll"></a><b>PRINTER & AKSESORIS</b></p>
    </section>
  );
}

function Section3(){
  return(
    <section class="iklan">
      <ul>
        <Setting2 link="produk.html#laptop" image="A.jpg" />
                  <Setting2 link="produk.html#hp" image="B.jpg" />
                  <Setting2 link="produk.html#dll" image="C.jpg" />
                  <Setting2 link="produk.html#dll" image="D.jpg" />
                  <Setting2 link="produk.html#dll" image="E.jpg" />
                  <Setting2 link="produk.html#dll" image="F.jpg" />
              </ul>
          </section>
  );
}
